#[test]
fn limbs_extended_gcd_properties() {
    let mut config = GenConfig::new();
    config.insert("mean_length_n", 512);
    config.insert("mean_stripe_n", 64 << Limb::LOG_WIDTH);
    unsigned_vec_pair_gen_var_11().test_properties_with_config(&config, |(mut xs, mut ys)| {
        let a = Natural::from_limbs_asc(&xs);
        let b = Natural::from_limbs_asc(&ys);
        let mut gs = vec![0; ys.len()];
        let mut ss = vec![0; ys.len() + 1];
        let (g_len, ss_sign) = limbs_extended_gcd(&mut gs, &mut ss, &mut xs, &mut ys);
        gs.truncate(g_len);
        let result = (&a).extended_gcd(&b);
        let (gcd, x, _) = result;
        assert_eq!(Natural::from_owned_limbs_asc(gs), gcd);
        assert_eq!(
            Integer::from_sign_and_abs(ss_sign, Natural::from_owned_limbs_asc(ss)),
            x
        );
    });
}

fn extended_gcd_properties_helper(a: Natural, b: Natural) {
    let result_val_val = a.clone().extended_gcd(b.clone());
    let result_val_ref = a.clone().extended_gcd(&b);
    let result_ref_val = (&a).extended_gcd(b.clone());
    let result = (&a).extended_gcd(&b);
    assert!(result_val_val.0.is_valid());
    assert!(result_val_val.1.is_valid());
    assert!(result_val_val.2.is_valid());
    assert!(result_val_ref.0.is_valid());
    assert!(result_val_ref.1.is_valid());
    assert!(result_val_ref.2.is_valid());
    assert!(result_ref_val.0.is_valid());
    assert!(result_ref_val.1.is_valid());
    assert!(result_ref_val.2.is_valid());
    assert!(result.0.is_valid());
    assert!(result.1.is_valid());
    assert!(result.2.is_valid());
    assert_eq!(result_val_val, result);
    assert_eq!(result_val_ref, result);
    assert_eq!(result_ref_val, result);

    let (gcd, x, y) = result;

    let (rug_gcd, rug_x, rug_y) =
        rug::Integer::from(&a).extended_gcd(rug::Integer::from(&b), rug::Integer::new());
    assert_eq!(Natural::exact_from(&rug_gcd), gcd);
    assert_eq!(Integer::from(&rug_x), x);
    assert_eq!(Integer::from(&rug_y), y);

    assert_eq!((&a).gcd(&b), gcd);
    assert_eq!(
        Integer::from(&a) * &x + Integer::from(&b) * &y,
        Integer::from(&gcd)
    );

    // uniqueness
    if a != 0u32 && b != 0u32 && &gcd != min(&a, &b) {
        assert!(x.le_abs(&((&b).div_exact(&gcd) >> 1)));
        assert!(y.le_abs(&((&a).div_exact(&gcd) >> 1)));
    }

    let result = extended_gcd_euclidean_natural(a.clone(), b.clone());
    assert_eq!(result.0, gcd);
    assert_eq!(result.1, x);
    assert_eq!(result.2, y);

    let result = extended_gcd_binary_natural(a.clone(), b.clone());
    assert_eq!(result.0, gcd);
    assert_eq!(result.1, x);
    assert_eq!(result.2, y);

    let eq = a == b;
    let reverse = (b).extended_gcd(a);
    if eq {
        assert_eq!(reverse, (gcd, x, y));
    } else {
        assert_eq!(reverse, (gcd, y, x));
    }
}

#[test]
fn extended_gcd_properties() {
    let mut config = GenConfig::new();
    config.insert("mean_bits_n", 2048);
    config.insert("mean_stripe_n", 512 << Limb::LOG_WIDTH);
    natural_pair_gen().test_properties_with_config(&config, |(a, b)| {
        extended_gcd_properties_helper(a, b);
    });

    natural_pair_gen_var_4().test_properties_with_config(&config, |(a, b)| {
        extended_gcd_properties_helper(a, b);
    });

    natural_gen().test_properties(|x| {
        if x != 0u32 {
            let result = (&x).extended_gcd(&x);
            assert_eq!(result.0, x);
            assert_eq!(result.1, 0u32);
            assert_eq!(result.2, 1u32);
            let result = (&x).extended_gcd(Natural::ZERO);
            assert_eq!(result.0, x);
            assert_eq!(result.1, 1u32);
            assert_eq!(result.2, 0u32);
            let result = Natural::ZERO.extended_gcd(&x);
            assert_eq!(result.0, x);
            assert_eq!(result.1, 0u32);
            assert_eq!(result.2, 1u32);
        }
        if x != 1u32 {
            assert_eq!(
                Natural::ONE.extended_gcd(&x),
                (Natural::ONE, Integer::ONE, Integer::ZERO)
            );
        }
        assert_eq!(
            (&x).extended_gcd(Natural::ONE),
            (Natural::ONE, Integer::ZERO, Integer::ONE)
        );
    });

    unsigned_pair_gen_var_27::<Limb>().test_properties(|(a, b)| {
        let (u_gcd, u_x, u_y) = a.extended_gcd(b);
        let (gcd, x, y) = Natural::from(a).extended_gcd(Natural::from(b));
        assert_eq!(gcd, u_gcd);
        assert_eq!(x, u_x);
        assert_eq!(y, u_y);
    });
}
